import React from "react";
import { Route, Switch } from "react-router-dom";
import Employeelist from "./pim/Employeelist";
import Addemployee from "./pim/Addemployee";
import Menutabs from "./pim/Menutabs"; // Import Menutabs here if it's used in Employeelist

export default function Pim() {
  return (
    <div className="">
      <Menutabs /> {/* Render Menutabs for both routes */}
      <Switch>
        <Route path="/pim/addemployee" component={Addemployee} />
        <Route path="/pim" component={Employeelist} />
      </Switch>
    </div>
  );
}
